@testset "1.1.3.8 P(x) (c x)^m (a+b x^n)^p" begin
    (A, B, C, a, b, c, d, e, f, g, h, i, j, m, n, p, x, ) = @variables A B C a b c d e f g h i j m n p x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*Pq(x)*(a+b*x^n)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*Pq(x)*(a+b*x^1)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*P(x)*(a+b*x)^(m/2)=#


    #= ::Subsubsection:: =#
    #=p>0=#


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [(c + d*x + e*x^2)^1/sqrt(a + b*x), x, 2, (2*(b^2*c - a*b*d + a^2*e)*sqrt(a + b*x))/b^3 + (2*(b*d - 2*a*e)*(a + b*x)^(3/2))/(3*b^3) + (2*e*(a + b*x)^(5/2))/(5*b^3)]
    @test_int [(c + d*x + e*x^2)^2/sqrt(a + b*x), x, 2, (2*(b^2*c - a*b*d + a^2*e)^2*sqrt(a + b*x))/b^5 + (4*(b*d - 2*a*e)*(b^2*c - a*b*d + a^2*e)*(a + b*x)^(3/2))/(3*b^5) - (2*(6*a*b*d*e - 6*a^2*e^2 - b^2*(d^2 + 2*c*e))*(a + b*x)^(5/2))/(5*b^5) + (4*e*(b*d - 2*a*e)*(a + b*x)^(7/2))/(7*b^5) + (2*e^2*(a + b*x)^(9/2))/(9*b^5)]
    @test_int [(c + d*x + e*x^2)^3/sqrt(a + b*x), x, 2, (2*(b^2*c - a*b*d + a^2*e)^3*sqrt(a + b*x))/b^7 + (2*(b*d - 2*a*e)*(b^2*c - a*b*d + a^2*e)^2*(a + b*x)^(3/2))/b^7 - (6*(b^2*c - a*b*d + a^2*e)*(5*a*b*d*e - 5*a^2*e^2 - b^2*(d^2 + c*e))*(a + b*x)^(5/2))/(5*b^7) - (2*(b*d - 2*a*e)*(10*a*b*d*e - 10*a^2*e^2 - b^2*(d^2 + 6*c*e))*(a + b*x)^(7/2))/(7*b^7) - (2*e*(5*a*b*d*e - 5*a^2*e^2 - b^2*(d^2 + c*e))*(a + b*x)^(9/2))/(3*b^7) + (6*e^2*(b*d - 2*a*e)*(a + b*x)^(11/2))/(11*b^7) + (2*e^3*(a + b*x)^(13/2))/(13*b^7)]


    @test_int [(c + d*x + e*x^2 + f*x^3)^1/sqrt(a + b*x), x, 2, (2*(b^3*c - a*b^2*d + a^2*b*e - a^3*f)*sqrt(a + b*x))/b^4 + (2*(b^2*d - 2*a*b*e + 3*a^2*f)*(a + b*x)^(3/2))/(3*b^4) + (2*(b*e - 3*a*f)*(a + b*x)^(5/2))/(5*b^4) + (2*f*(a + b*x)^(7/2))/(7*b^4)]
    @test_int [(c + d*x + e*x^2 + f*x^3)^2/sqrt(a + b*x), x, 2, (2*(b^3*c - a*b^2*d + a^2*b*e - a^3*f)^2*sqrt(a + b*x))/b^7 + (4*(b^2*d - 2*a*b*e + 3*a^2*f)*(b^3*c - a*b^2*d + a^2*b*e - a^3*f)*(a + b*x)^(3/2))/(3*b^7) + (2*(b^4*(d^2 + 2*c*e) - 20*a^3*b*e*f + 15*a^4*f^2 - 6*a*b^3*(d*e + c*f) + 6*a^2*b^2*(e^2 + 2*d*f))*(a + b*x)^(5/2))/(5*b^7) + (4*(10*a^2*b*e*f - 10*a^3*f^2 + b^3*(d*e + c*f) - 2*a*b^2*(e^2 + 2*d*f))*(a + b*x)^(7/2))/(7*b^7) - (2*(10*a*b*e*f - 15*a^2*f^2 - b^2*(e^2 + 2*d*f))*(a + b*x)^(9/2))/(9*b^7) + (4*f*(b*e - 3*a*f)*(a + b*x)^(11/2))/(11*b^7) + (2*f^2*(a + b*x)^(13/2))/(13*b^7)]
    @test_int [(c + d*x + e*x^2 + f*x^3)^3/sqrt(a + b*x), x, 2, (2*(b^3*c - a*b^2*d + a^2*b*e - a^3*f)^3*sqrt(a + b*x))/b^10 + (2*(b^2*d - 2*a*b*e + 3*a^2*f)*(b^3*c - a*b^2*d + a^2*b*e - a^3*f)^2*(a + b*x)^(3/2))/b^10 + (6*(b^3*c - a*b^2*d + a^2*b*e - a^3*f)*(b^4*(d^2 + c*e) - 16*a^3*b*e*f + 12*a^4*f^2 - a*b^3*(5*d*e + 3*c*f) + a^2*b^2*(5*e^2 + 9*d*f))*(a + b*x)^(5/2))/(5*b^10) - (2*(168*a^5*b*e*f^2 - 84*a^6*f^3 - b^6*(d^3 + 6*c*d*e + 3*c^2*f) - 105*a^4*b^2*f*(e^2 + d*f) + 12*a*b^5*(d^2*e + c*e^2 + 2*c*d*f) - 30*a^2*b^4*(d*e^2 + d^2*f + 2*c*e*f) + 20*a^3*b^3*(e^3 + 6*d*e*f + 3*c*f^2))*(a + b*x)^(7/2))/(7*b^10) + (2*(70*a^4*b*e*f^2 - 42*a^5*f^3 - 35*a^3*b^2*f*(e^2 + d*f) + b^5*(d^2*e + c*e^2 + 2*c*d*f) - 5*a*b^4*(d*e^2 + d^2*f + 2*c*e*f) + 5*a^2*b^3*(e^3 + 6*d*e*f + 3*c*f^2))*(a + b*x)^(9/2))/(3*b^10) - (6*(56*a^3*b*e*f^2 - 42*a^4*f^3 - 21*a^2*b^2*f*(e^2 + d*f) - b^4*(d*e^2 + d^2*f + 2*c*e*f) + 2*a*b^3*(e^3 + 6*d*e*f + 3*c*f^2))*(a + b*x)^(11/2))/(11*b^10) + (2*(84*a^2*b*e*f^2 - 84*a^3*f^3 - 21*a*b^2*f*(e^2 + d*f) + b^3*(e^3 + 6*d*e*f + 3*c*f^2))*(a + b*x)^(13/2))/(13*b^10) - (2*f*(8*a*b*e*f - 12*a^2*f^2 - b^2*(e^2 + d*f))*(a + b*x)^(15/2))/(5*b^10) + (6*f^2*(b*e - 3*a*f)*(a + b*x)^(17/2))/(17*b^10) + (2*f^3*(a + b*x)^(19/2))/(19*b^10)]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*Pq(x)*(a+b*x^3)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*P1(x)*(a+b*x^3)^p=#


    @test_int [(c + d*x)/(a + b*x^3), x, 6, -(((b^(1/3)*c + a^(1/3)*d)*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(2/3)*b^(2/3))) + ((b^(1/3)*c - a^(1/3)*d)*log(a^(1/3) + b^(1/3)*x))/(3*a^(2/3)*b^(2/3)) - ((c - (a^(1/3)*d)/b^(1/3))*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(6*a^(2/3)*b^(1/3))]


    @test_int [(c + d*x)/(a + b*x^3)^2, x, 7, (x*(c + d*x))/(3*a*(a + b*x^3)) - ((2*b^(1/3)*c + a^(1/3)*d)*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(3*sqrt(3)*a^(5/3)*b^(2/3)) + ((2*b^(1/3)*c - a^(1/3)*d)*log(a^(1/3) + b^(1/3)*x))/(9*a^(5/3)*b^(2/3)) - ((2*b^(1/3)*c - a^(1/3)*d)*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(18*a^(5/3)*b^(2/3))]


    @test_int [(c + d*x)/(a + b*x^3)^3, x, 8, (x*(c + d*x))/(6*a*(a + b*x^3)^2) + (x*(5*c + 4*d*x))/(18*a^2*(a + b*x^3)) - ((5*b^(1/3)*c + 2*a^(1/3)*d)*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(9*sqrt(3)*a^(8/3)*b^(2/3)) + ((5*b^(1/3)*c - 2*a^(1/3)*d)*log(a^(1/3) + b^(1/3)*x))/(27*a^(8/3)*b^(2/3)) - ((5*b^(1/3)*c - 2*a^(1/3)*d)*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(54*a^(8/3)*b^(2/3))]


    @test_int [(c + d*x)/(a + b*x^3)^4, x, 9, (x*(c + d*x))/(9*a*(a + b*x^3)^3) + (x*(8*c + 7*d*x))/(54*a^2*(a + b*x^3)^2) + (2*x*(10*c + 7*d*x))/(81*a^3*(a + b*x^3)) - (2*(20*b^(1/3)*c + 7*a^(1/3)*d)*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(81*sqrt(3)*a^(11/3)*b^(2/3)) + (2*(20*b^(1/3)*c - 7*a^(1/3)*d)*log(a^(1/3) + b^(1/3)*x))/(243*a^(11/3)*b^(2/3)) - ((20*b^(1/3)*c - 7*a^(1/3)*d)*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(243*a^(11/3)*b^(2/3))]


    @test_int [(a + b*x)/(d + e*x^3), x, 6, -(((b*d^(1/3) + a*e^(1/3))*atan((d^(1/3) - 2*e^(1/3)*x)/(sqrt(3)*d^(1/3))))/(sqrt(3)*d^(2/3)*e^(2/3))) - ((b*d^(1/3) - a*e^(1/3))*log(d^(1/3) + e^(1/3)*x))/(3*d^(2/3)*e^(2/3)) - ((a - (b*d^(1/3))/e^(1/3))*log(d^(2/3) - d^(1/3)*e^(1/3)*x + e^(2/3)*x^2))/(6*d^(2/3)*e^(1/3))]
    @test_int [(a + b*x)/(d - e*x^3), x, 6, -(((b*d^(1/3) - a*e^(1/3))*atan((d^(1/3) + 2*e^(1/3)*x)/(sqrt(3)*d^(1/3))))/(sqrt(3)*d^(2/3)*e^(2/3))) - ((b*d^(1/3) + a*e^(1/3))*log(d^(1/3) - e^(1/3)*x))/(3*d^(2/3)*e^(2/3)) + ((b*d^(1/3) + a*e^(1/3))*log(d^(2/3) + d^(1/3)*e^(1/3)*x + e^(2/3)*x^2))/(6*d^(2/3)*e^(2/3))]

    @test_int [(1 + x)/(1 + x^3), x, 3, -((2*atan((1 - 2*x)/sqrt(3)))/sqrt(3))]
    @test_int [(1 - x)/(1 - x^3), x, 3, (2*atan((1 + 2*x)/sqrt(3)))/sqrt(3)]
    @test_int [(1 + x)/(1 - x^3), x, 3, -(2/3)*log(1 - x) + (1/3)*log(1 + x + x^2)]
    @test_int [(1 - x)/(1 + x^3), x, 3, (2/3)*log(1 + x) - (1/3)*log(1 - x + x^2)]

    @test_int [(3 - x)/(1 - x^3), x, 6, (4*atan((1 + 2*x)/sqrt(3)))/sqrt(3) - (2/3)*log(1 - x) + (1/3)*log(1 + x + x^2)]

    @test_int [(c + d*x)/(c^3 + d^3*x^3), x, 3, -((2*atan((c - 2*d*x)/(sqrt(3)*c)))/(sqrt(3)*c*d))]
    @test_int [(c - d*x)/(c^3 - d^3*x^3), x, 3, (2*atan((c + 2*d*x)/(sqrt(3)*c)))/(sqrt(3)*c*d)]

    @test_int [(a^(1/3)*b^(1/3)*B + b^(2/3)*B*x)/(a + b*x^3), x, 3, -((2*B*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(1/3)))]
    @test_int [(a^(1/3)*(-b)^(1/3)*B - (-b)^(2/3)*B*x)/(a + b*x^3), x, 3, (2*B*atan((a^(1/3) + 2*(-b)^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(1/3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*P2(x)*(a+b*x^3)^p=#


    @test_int [(0 + B*x + C*x^2)/(a + b*x^3) - (C*x^2)/(a + b*x^3), x, 12, -((B*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(1/3)*b^(2/3))) - (B*log(a^(1/3) + b^(1/3)*x))/(3*a^(1/3)*b^(2/3)) + (B*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(6*a^(1/3)*b^(2/3))]
    @test_int [(A + 0*x + C*x^2)/(a + b*x^3) - (C*x^2)/(a + b*x^3), x, 11, -((A*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(2/3)*b^(1/3))) + (A*log(a^(1/3) + b^(1/3)*x))/(3*a^(2/3)*b^(1/3)) - (A*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(6*a^(2/3)*b^(1/3))]
    @test_int [(A + B*x + C*x^2)/(a + b*x^3) - (C*x^2)/(a + b*x^3), x, 10, -(((A*b^(1/3) + a^(1/3)*B)*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(2/3)*b^(2/3))) + ((A*b^(1/3) - a^(1/3)*B)*log(a^(1/3) + b^(1/3)*x))/(3*a^(2/3)*b^(2/3)) - ((A - (a^(1/3)*B)/b^(1/3))*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(6*a^(2/3)*b^(1/3))]


    @test_int [(b*x + c*x^2)/(d + e*x^3), x, 10, -((b*atan((d^(1/3) - 2*e^(1/3)*x)/(sqrt(3)*d^(1/3))))/(sqrt(3)*d^(1/3)*e^(2/3))) - (b*log(d^(1/3) + e^(1/3)*x))/(3*d^(1/3)*e^(2/3)) + (b*log(d^(2/3) - d^(1/3)*e^(1/3)*x + e^(2/3)*x^2))/(6*d^(1/3)*e^(2/3)) + (c*log(d + e*x^3))/(3*e)]
    @test_int [(a + c*x^2)/(d - e*x^3), x, 9, (a*atan((d^(1/3) + 2*e^(1/3)*x)/(sqrt(3)*d^(1/3))))/(sqrt(3)*d^(2/3)*e^(1/3)) - (a*log(d^(1/3) - e^(1/3)*x))/(3*d^(2/3)*e^(1/3)) + (a*log(d^(2/3) + d^(1/3)*e^(1/3)*x + e^(2/3)*x^2))/(6*d^(2/3)*e^(1/3)) - (c*log(d - e*x^3))/(3*e)]

    @test_int [(2*a^2 + b^2*x^2)/(a^3 + b^3*x^3), x, 4, -((2*atan((a - 2*b*x)/(sqrt(3)*a)))/(sqrt(3)*b)) + log(a + b*x)/b]
    @test_int [(2*a^2 + b^2*x^2)/(a^3 - b^3*x^3), x, 4, (2*atan((a + 2*b*x)/(sqrt(3)*a)))/(sqrt(3)*b) - log(a - b*x)/b]

    @test_int [(8*C + b^(2/3)*C*x^2)/(8 + b*x^3), x, 4, -((2*C*atan((1 - b^(1/3)*x)/sqrt(3)))/(sqrt(3)*b^(1/3))) + (C*log(2 + b^(1/3)*x))/b^(1/3)]
    @test_int [(a^(2/3)*C + 2*C*x^2)/(a + 8*x^3), x, 4, -((C*atan((a^(1/3) - 4*x)/(sqrt(3)*a^(1/3))))/(2*sqrt(3))) + (1/4)*C*log(a^(1/3) + 2*x)]

    @test_int [(8*C + (-b)^(2/3)*C*x^2)/(-8 + b*x^3), x, 4, (2*C*atan((1 - (-b)^(1/3)*x)/sqrt(3)))/(sqrt(3)*(-b)^(1/3)) - (C*log(2 + (-b)^(1/3)*x))/(-b)^(1/3)]
    @test_int [((-a)^(2/3)*C + 2*C*x^2)/(a - 8*x^3), x, 4, (C*atan((1 - (4*x)/(-a)^(1/3))/sqrt(3)))/(2*sqrt(3)) - (1/4)*C*log((-a)^(1/3) + 2*x)]

    @test_int [(2*C*(a/b)^(2/3) + C*x^2)/(a + b*x^3), x, 4, -((2*C*atan((1 - (2*x)/(a/b)^(1/3))/sqrt(3)))/(sqrt(3)*b)) + (C*log((a/b)^(1/3) + x))/b]
    @test_int [(2*C*(-a/b)^(2/3) + C*x^2)/(a - b*x^3), x, 4, (2*C*atan((1 - (2*x)/(-(a/b))^(1/3))/sqrt(3)))/(sqrt(3)*b) - (C*log((-(a/b))^(1/3) + x))/b]

    @test_int [(2*C*(-a/b)^(2/3) + C*x^2)/(a + b*x^3), x, 4, -((2*C*atan((1 + (2*x)/(-(a/b))^(1/3))/sqrt(3)))/(sqrt(3)*b)) + (C*log((-(a/b))^(1/3) - x))/b]
    @test_int [(2*C*(a/b)^(2/3) + C*x^2)/(a - b*x^3), x, 4, (2*C*atan((1 + (2*x)/(a/b)^(1/3))/sqrt(3)))/(sqrt(3)*b) - (C*log((a/b)^(1/3) - x))/b]

    @test_int [(2*a^(2/3)*C + b^(2/3)*C*x^2)/(a + b*x^3), x, 4, -((2*C*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*b^(1/3))) + (C*log(a^(1/3) + b^(1/3)*x))/b^(1/3)]
    @test_int [(-2*a^(2/3)*C - (-b)^(2/3)*C*x^2)/(a + b*x^3), x, 4, -((2*C*atan((a^(1/3) + 2*(-b)^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*(-b)^(1/3))) + (C*log(a^(1/3) - (-b)^(1/3)*x))/(-b)^(1/3)]

    @test_int [(-3 + x^2)/(-1 + x^3), x, 6, sqrt(3)*atan((1 + 2*x)/sqrt(3)) - (2*log(1 - x))/3 + (5*log(1 + x + x^2))/6]


    @test_int [(a^(1/3)*b^(1/3)*B + 2*a^(2/3)*C + b^(2/3)*B*x + b^(2/3)*C*x^2)/(a + b*x^3), x, 4, -((2*(B/a^(1/3) + C/b^(1/3))*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/sqrt(3)) + (C*log(a^(1/3) + b^(1/3)*x))/b^(1/3)]
    @test_int [(a^(1/3)*(-b)^(1/3)*B - 2*a^(2/3)*C - (-b)^(2/3)*B*x - (-b)^(2/3)*C*x^2)/(a + b*x^3), x, 4, (2*(b*B + a^(1/3)*(-b)^(2/3)*C)*atan((a^(1/3) + 2*(-b)^(1/3)*x)/(sqrt(3)*a^(1/3))))/(sqrt(3)*a^(1/3)*b) + (C*log(a^(1/3) - (-b)^(1/3)*x))/(-b)^(1/3)]


    @test_int [(B^2 + B*C*x + C^2*x^2)/(-B^3 + C^3*x^3), x, 2, log(B - C*x)/C]
    @test_int [(a^(2/3)*C - a^(1/3)*b^(1/3)*C*x + b^(2/3)*C*x^2)/(a + b*x^3), x, 2, (C*log(a^(1/3) + b^(1/3)*x))/b^(1/3)]


    @test_int [((a/b)^(1/3)*B + 2*(a/b)^(2/3)*C + B*x + C*x^2)/(a + b*x^3), x, 4, -((2*(a/b)^(2/3)*(B + (a/b)^(1/3)*C)*atan((1 - (2*x)/(a/b)^(1/3))/sqrt(3)))/(sqrt(3)*a)) + (C*log((a/b)^(1/3) + x))/b]
    @test_int [((-(a/b))^(1/3)*B + 2*(-(a/b))^(2/3)*C + B*x + C*x^2)/(a - b*x^3), x, 4, (2*(B + (-(a/b))^(1/3)*C)*atan((1 - (2*x)/(-(a/b))^(1/3))/sqrt(3)))/(sqrt(3)*(-(a/b))^(1/3)*b) - (C*log((-(a/b))^(1/3) + x))/b]

    @test_int [((-(-(a/b))^(1/3))*B + 2*(-(a/b))^(2/3)*C + B*x + C*x^2)/(a + b*x^3), x, 4, (2*(B - (-(a/b))^(1/3)*C)*atan((1 + (2*x)/(-(a/b))^(1/3))/sqrt(3)))/(sqrt(3)*(-(a/b))^(1/3)*b) + (C*log((-(a/b))^(1/3) - x))/b]
    @test_int [((-(a/b)^(1/3))*B + 2*(a/b)^(2/3)*C + B*x + C*x^2)/(a - b*x^3), x, 4, -((2*(a/b)^(2/3)*(B - (a/b)^(1/3)*C)*atan((1 + (2*x)/(a/b)^(1/3))/sqrt(3)))/(sqrt(3)*a)) - (C*log((a/b)^(1/3) - x))/b]


    @test_int [(a + a*x + c*x^2)/(1 - x^3), x, 3, (-(1/3))*(2*a + c)*log(1 - x) + (1/3)*(a - c)*log(1 + x + x^2)]
    @test_int [(a + b*x + c*x^2)/(1 - x^3), x, 6, ((a - b)*atan((1 + 2*x)/sqrt(3)))/sqrt(3) - (1/3)*(a + b + c)*log(1 - x) + (1/6)*(a + b - 2*c)*log(1 + x + x^2)]

    @test_int [(1 + x + x^2)/(1 - x^3), x, 2, -log(1-x)]
    @test_int [(1 - x + 3*x^2)/(1 - x^3), x, 5, ((2*atan((1 + 2*x)/sqrt(3)))/sqrt(3)) - log(1 - x^3)]
    @test_int [(1 + x + 4*x^2)/(1 - x^3), x, 3, -2*log(1 - x) - log(1 + x + x^2)]


